import React from "react";
import Meaning from "./Meaning";

const Results = (props) => {
  if (props.results) {
    return (
      <div>
        <h2>{props.results.word}</h2>
        <Meaning />
      </div>
    );
  } else {
    return null;
  }
};

export default Results;
